import Box from "@mui/material/Box";
import Modal from "@mui/material/Modal";
import React from "react";
import CancelIcon from "@mui/icons-material/Cancel";
import { TextField } from "@mui/material";
const style = {
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  bgcolor: "background.paper",
  boxShadow: 24,
  p: 2,
};

function FormCreationModal(props) {
  return (
    <div>
      <Modal
        open={props.openFormCreationModal}
        // onClose={handleCloseFormCreationModal}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style} className="w-[80%] h-[60%]">
          <div className="flex justify-end">
            <button type="button" onClick={props.handleCloseFormCreationModal}>
              <CancelIcon className="text-red-600" />
            </button>
          </div>
          <form>
            <TextField name="First Name" label="First Name" />
            <TextField name="Middle Name" label="Middle Name" />

            <TextField name="Last Name" label="Last Name" />
          </form>
        </Box>
      </Modal>
    </div>
  );
}

export default FormCreationModal;
